import streamlit as st
import pickle
import json
import numpy as np

__locations = None
__data_columns = None
__model = None




def load_saved_artifacts():
    print("loading saved artifacts...start")
    global  __data_columns
    global __locations

    with open("./columns_c.json", "r") as f:
        __data_columns = json.load(f)['data_columns']
        __locations = __data_columns[3:]  # first 3 columns are sqft, bath, bhk

    global __model
    if __model is None:
        with open('./chennai_model.pickle', 'rb') as f:
            __model = pickle.load(f)
    print("loading saved artifacts...done")

def get_location_names():
    return __locations

def get_data_columns():
    return __data_columns


def get_estimated_price(location,sqft,status,bhk):
    load_saved_artifacts()
    try:
        loc_index = __data_columns.index(location.lower())
    except:
        loc_index = -1

    x = np.zeros(len(__data_columns))
    x[0] = sqft
    x[1] = status
    x[2] = bhk
    if loc_index>=0:
        x[loc_index] = 1

    return round(__model.predict([x])[0],2)

st.title("CHENNAI HOUSE PRICE PREDICTION")

def set_bg_hack_url():
    '''
    A function to unpack an image from url and set as bg.
    Returns
    -------
    The background.
    '''

    st.markdown(
        f"""
         <style>
         .stApp {{
             background: url("data:image/jpg;base64,");
             background-size: cover
         }}
         </style>
         """,
        unsafe_allow_html=True
    )
set_bg_hack_url()

load_saved_artifacts()
get_location_names()


location=st.selectbox(
     'Select the location',
     (__locations))
sqft = st.text_area("Enter the sqft")
status = st.text_area("Enter 0 for ready status and 1 for under construction")
bhk = st.text_area("Enter the bhk")


if st.button('Estimate the Price'):


    result = get_estimated_price(location, sqft,status, bhk)
    # 4. Display
    st.header(str(result)+" "+"lakhs")
